DROP TABLE IF EXISTS `caja`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!40101 SET character_set_client = utf8 */;
CREATE TABLE `caja` (
  `id` int(11) NOT NULL AUTO_INCREMENT COMMENT 'IDENTIFICADOR PRINCIPAL',
  `nombre` varchar(45) NOT NULL,
  `id_ubicacion` int(11) NOT NULL COMMENT 'LUGAR EN DONDE SE ENCUENTRA LA CAJA',
  `estado` tinyint(1) NOT NULL DEFAULT '0',
  `creado` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP COMMENT 'HORA DE CREACIN DEL REGISTRO',
  `creado_por` int(10) unsigned NOT NULL COMMENT 'USUARIO QUE CREA EL REGISTRO',
  `actualizado` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP COMMENT 'HORA DE ACTUALIZACIN DEL REGISTRO',
  `actualizado_por` int(10) unsigned NOT NULL COMMENT 'USUARIO QUE MODIFICA EL REGISTRO',
  `eliminado` datetime DEFAULT NULL COMMENT 'USUARIO QUE ELIMINA EL REGISTRO',
  `eliminado_por` int(10) unsigned DEFAULT NULL COMMENT 'USUARIO QUE ELIMINA EL REGISTRO',
  PRIMARY KEY (`id`),
  KEY `fk_caja_ubicacion1_idx` (`id_ubicacion`),
  KEY `fk_caja_user_creado_por_idx` (`creado_por`),
  KEY `fk_caja_user_actualizado_por_idx` (`actualizado_por`),
  CONSTRAINT `fk_caja_ubicacion` FOREIGN KEY (`id_ubicacion`) REFERENCES `ubicacion` (`id`) ON DELETE NO ACTION ON UPDATE NO ACTION,
  CONSTRAINT `fk_caja_user_actualizado_por` FOREIGN KEY (`actualizado_por`) REFERENCES `dreamfactory`.`user` (`id`) ON DELETE NO ACTION ON UPDATE NO ACTION,
  CONSTRAINT `fk_caja_user_creado_por` FOREIGN KEY (`creado_por`) REFERENCES `dreamfactory`.`user` (`id`) ON DELETE NO ACTION ON UPDATE NO ACTION
