DROP TABLE IF EXISTS `direccion_david`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!40101 SET character_set_client = utf8 */;
CREATE TABLE `direccion_david` (
  `id` int(11) NOT NULL AUTO_INCREMENT COMMENT 'IDENTIFICADOR PRINCIPAL',
  `id_usuario` int(11) DEFAULT NULL COMMENT 'USUARIO DE LA DIRECCION',
  `id_ubicacion` int(11) DEFAULT NULL COMMENT 'UBICACIN DE LA DIRECCION',
  `id_ciudad` int(11) DEFAULT NULL COMMENT 'CIUDAD DE LA DIRECCION',
  `direccion` varchar(255) DEFAULT NULL COMMENT 'PRIMERA LINEA DE LA DIRECCION',
  `direccion2` varchar(255) DEFAULT NULL COMMENT 'SEGUNDA LINEA DE LA DIRECCION',
  `nombre` varchar(45) DEFAULT NULL,
  `latitud` double DEFAULT NULL COMMENT 'LATITUD DE LA DIRECCION',
  `longitud` double DEFAULT NULL COMMENT 'LONGITUD DE LA DIRECCION',
  `creado` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP COMMENT 'HORA DE CREACIN DEL REGISTRO',
  `creado_por` int(11) NOT NULL,
  `actualizado` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP COMMENT 'HORA DE ACTUALIZACIN DEL REGISTRO',
  `actualizado_por` int(11) NOT NULL,
  `eliminado` datetime DEFAULT NULL COMMENT 'USUARIO QUE ELIMINA EL REGISTRO',
  `eliminado_por` int(10) unsigned DEFAULT NULL COMMENT 'USUARIO QUE ELIMINA EL REGISTRO',
  PRIMARY KEY (`id`),
  KEY `fk_direcciones_usuarios1_idx_2` (`id_usuario`),
  KEY `fk_direcciones_ciudad1_idx_2` (`id_ciudad`),
  KEY `fk_direcciones_ubicaciones1_idx_2` (`id_ubicacion`),
  CONSTRAINT `fk_direcciones_ciudad1_2` FOREIGN KEY (`id_ciudad`) REFERENCES `ciudad` (`id_pais`) ON DELETE NO ACTION ON UPDATE NO ACTION,
  CONSTRAINT `fk_direcciones_ubicaciones1_2` FOREIGN KEY (`id_ubicacion`) REFERENCES `ubicacion` (`id`) ON DELETE NO ACTION ON UPDATE NO ACTION,
  CONSTRAINT `fk_direcciones_usuarios1_2` FOREIGN KEY (`id_usuario`) REFERENCES `usuario` (`id`) ON DELETE NO ACTION ON UPDATE NO ACTION
) ENGINE=InnoDB AUTO_INCREMENT=1109 DEFAULT CHARSET=utf8;
/*!40101 SET character_set_client = @saved_cs_client */;

