  `direccion2` varchar(255) DEFAULT NULL COMMENT 'SEGUNDA LINEA DE LA DIRECCION',
  `nombre` varchar(45) DEFAULT NULL,
  `latitud` double DEFAULT NULL COMMENT 'LATITUD DE LA DIRECCION',
  `longitud` double DEFAULT NULL COMMENT 'LONGITUD DE LA DIRECCION',
  `creado` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP COMMENT 'HORA DE CREACIN DEL REGISTRO',
  `creado_por` int(11) NOT NULL,
  `actualizado` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP COMMENT 'HORA DE ACTUALIZACIN DEL REGISTRO',
  `actualizado_por` int(11) NOT NULL,
  `eliminado` datetime DEFAULT NULL COMMENT 'USUARIO QUE ELIMINA EL REGISTRO',
  `eliminado_por` int(10) unsigned DEFAULT NULL COMMENT 'USUARIO QUE ELIMINA EL REGISTRO',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=1109 DEFAULT CHARSET=utf8;
