--
-- Table structure for table `empresa`
--

DROP TABLE IF EXISTS `empresa`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!40101 SET character_set_client = utf8 */;
CREATE TABLE `empresa` (
  `id` int(11) NOT NULL AUTO_INCREMENT COMMENT 'IDENTIFICADOR PRINCIPAL',
  `id_tipo_documento` int(11) NOT NULL COMMENT 'TIPO DE DOCUMENTO DE LA EMPRESA AFILIADA',
  `nro_documento` varchar(255) NOT NULL COMMENT 'NUMERO DE DOCUMENTO DE LA EMPRESA AFILIADA',
  `nombre` varchar(255) NOT NULL COMMENT 'NOMBRE DE LA EMPRESA AFILIADA',
  `telefono_contacto` varchar(255) NOT NULL,
  `ciudad_id` int(11) NOT NULL DEFAULT '0',
  `creado` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP COMMENT 'HORA DE CREACIN DEL REGISTRO',
  `creado_por` int(10) unsigned NOT NULL COMMENT 'USUARIO QUE CREA EL REGISTRO',
  `actualizado` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP COMMENT 'HORA DE ACTUALIZACIN DEL REGISTRO',
  `actualizado_por` int(10) unsigned NOT NULL COMMENT 'USUARIO QUE MODIFICA EL REGISTRO',
  `eliminado` datetime DEFAULT NULL COMMENT 'USUARIO QUE ELIMINA EL REGISTRO',
  `eliminado_por` int(11) DEFAULT NULL,
  PRIMARY KEY (`id`),
  KEY `fk_empresa_tipo_documento1_idx` (`id_tipo_documento`),
  KEY `fk_empresa_user_creado_por_idx` (`creado_por`),
  KEY `fk_empresa_user_actualizado_por_idx` (`actualizado_por`),
  KEY `ndx_empresa_eliminado_por` (`eliminado_por`),
  KEY `ciudad_by_ciudad_id_idx` (`ciudad_id`),
  CONSTRAINT `ciudad_by_ciudad_id` FOREIGN KEY (`ciudad_id`) REFERENCES `ciudad` (`id`) ON DELETE NO ACTION ON UPDATE NO ACTION,
  CONSTRAINT `fk_empresa_tipo_documento` FOREIGN KEY (`id_tipo_documento`) REFERENCES `tipo_documento` (`id`) ON DELETE NO ACTION ON UPDATE NO ACTION,
  CONSTRAINT `fk_empresa_user_actualizado_por` FOREIGN KEY (`actualizado_por`) REFERENCES `dreamfactory`.`user` (`id`) ON DELETE NO ACTION ON UPDATE NO ACTION,
  CONSTRAINT `fk_empresa_user_creado_por` FOREIGN KEY (`creado_por`) REFERENCES `dreamfactory`.`user` (`id`) ON DELETE NO ACTION ON UPDATE NO ACTION
) ENGINE=InnoDB AUTO_INCREMENT=18 DEFAULT CHARSET=utf8;
/*!40101 SET character_set_client = @saved_cs_client */;

