DROP TABLE IF EXISTS `reserva`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!40101 SET character_set_client = utf8 */;
CREATE TABLE `reserva` (
  `id` int(11) NOT NULL AUTO_INCREMENT COMMENT 'IDENTIFICADOR PRINCIPAL',
  `id_servicio` int(11) NOT NULL,
  `id_usuario` int(11) NOT NULL,
  `id_direccion` int(11) DEFAULT NULL,
  `id_movimiento` int(11) DEFAULT NULL COMMENT 'MOVIMIENTO CAUSADO DE LA RESERVA',
  `estado` int(11) DEFAULT '0' COMMENT '-1 - CANCELADA\n0 - NUEVA\n1 - UTILIZADA\n2 - SIN UTILIZAR\n3 - FINALIZADA\n',
  `calificacion` int(11) DEFAULT NULL,
  `comentarios` varchar(255) DEFAULT NULL,
  `creado` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP COMMENT 'HORA DE CREACIN DEL REGISTRO',
  `creado_por` int(10) unsigned NOT NULL COMMENT 'USUARIO QUE CREA EL REGISTRO',
  `actualizado` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP COMMENT 'HORA DE ACTUALIZACIN DEL REGISTRO',
  `actualizado_por` int(10) unsigned NOT NULL COMMENT 'USUARIO QUE MODIFICA EL REGISTRO',
  `eliminado` datetime DEFAULT NULL COMMENT 'USUARIO QUE ELIMINA EL REGISTRO',
  `eliminado_por` int(10) unsigned DEFAULT NULL COMMENT 'USUARIO QUE ELIMINA EL REGISTRO',
  PRIMARY KEY (`id`),
  KEY `fk_usuario_reserva_reservas_idx` (`id_servicio`),
  KEY `fk_usuario_reserva_usuarios1_idx` (`id_usuario`),
  KEY `fk_usuario_reserva_movimientos1_idx` (`id_movimiento`),
  KEY `ndx_reserva_id_servicio` (`id_servicio`),
  KEY `ndx_reserva_id_usuario` (`id_usuario`),
  KEY `fk_reserva_user_creado_por_idx` (`creado_por`),
  KEY `fk_reserva_user_actualizado_por_idx` (`actualizado_por`),
  KEY `fk_reserva_user_eliminado_por_idx` (`eliminado_por`),
  KEY `fk_reserva_direccion_idx` (`id_direccion`),
  CONSTRAINT `fk_reserva_direccion` FOREIGN KEY (`id_direccion`) REFERENCES `direccion` (`id`) ON DELETE NO ACTION ON UPDATE NO ACTION,
  CONSTRAINT `fk_reserva_user_actualizado_por` FOREIGN KEY (`actualizado_por`) REFERENCES `dreamfactory`.`user` (`id`) ON DELETE NO ACTION ON UPDATE NO ACTION,
  CONSTRAINT `fk_reserva_user_creado_por` FOREIGN KEY (`creado_por`) REFERENCES `dreamfactory`.`user` (`id`) ON DELETE NO ACTION ON UPDATE NO ACTION,
  CONSTRAINT `fk_reserva_user_eliminado_por` FOREIGN KEY (`eliminado_por`) REFERENCES `dreamfactory`.`user` (`id`) ON DELETE NO ACTION ON UPDATE NO ACTION,
  CONSTRAINT `fk_usuario_reserva_movimientos1` FOREIGN KEY (`id_movimiento`) REFERENCES `movimiento` (`id`) ON DELETE NO ACTION ON UPDATE NO ACTION,
  CONSTRAINT `fk_usuario_reserva_reservas` FOREIGN KEY (`id_servicio`) REFERENCES `servicio` (`id`) ON DELETE NO ACTION ON UPDATE NO ACTION,
  CONSTRAINT `fk_usuario_reserva_usuarios1` FOREIGN KEY (`id_usuario`) REFERENCES `usuario` (`id`) ON DELETE NO ACTION ON UPDATE NO ACTION
) ENGINE=InnoDB AUTO_INCREMENT=307 DEFAULT CHARSET=utf8;
/*!40101 SET character_set_client = @saved_cs_client */;

