/*!50003 CREATE*/ /*!50017 DEFINER=`root`@`localhost`*/ /*!50003 TRIGGER `airlink_u`.`reserva_BEFORE_UPDATE` BEFORE UPDATE ON `reserva` FOR EACH ROW
BEGIN
	DECLARE isOk INT DEFAULT 0;
   IF NEW.estado = -1 AND OLD.estado!=-1 THEN
		SELECT COUNT(1) INTO isOk
        FROM servicio s WHERE s.id = NEW.id_servicio 
        AND s.eliminado IS NULL AND CURRENT_TIMESTAMP <= ( s.inicio_recogida_esperado- INTERVAL 30 MINUTE );
        IF isOk<=0 THEN
			SET NEW.estado = OLD.estado;
        END IF;
   END IF;
END */;;
