CREATE TABLE `servicio` (
  `id` int(11) NOT NULL AUTO_INCREMENT COMMENT 'IDENTIFICADOR PRINCIPAL',
  `id_conductor` int(11) NOT NULL COMMENT 'CONDUCTOR QUE REALIZARA EL SERVICIO',
  `id_vehiculo` int(11) NOT NULL COMMENT 'VEHICULO QUE REALIZARA EL SERVICIO',
  `id_ubicacion_origen` int(11) NOT NULL COMMENT 'UBICACION DE ORIGEN',
  `id_ubicacion_destino` int(11) NOT NULL COMMENT 'UBICACION DE DESTINO',
  `inicio_recogida_esperado` datetime NOT NULL COMMENT 'HORA ESPERADA DE INICIO DE SERVICIO',
  `fin_recogida_esperado` datetime NOT NULL COMMENT 'HORA MAXIMA DE FINALIZACIN DE RECOGIDAS',
  `en_destino_esperado` datetime NOT NULL COMMENT 'HORA ESPERADA DE ARRIBO AL DESTINO',
  `inicio_recogida_real` datetime DEFAULT NULL COMMENT 'HORA REAL DE INICIO DEL SERVICIO',
  `fin_recogida_real` datetime DEFAULT NULL COMMENT 'HORA REAL DE RECOGIDA ULTIMO PASAJERO',
  `en_destino_real` datetime DEFAULT NULL COMMENT 'HORA REAL DE FINALIZACIN DEL SERVICIO',
  `creado` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP COMMENT 'HORA DE CREACIN DEL REGISTRO',
  `creado_por` int(10) unsigned NOT NULL COMMENT 'USUARIO QUE CREA EL REGISTRO',
  `actualizado` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP COMMENT 'HORA DE ACTUALIZACIN DEL REGISTRO',
  `actualizado_por` int(10) unsigned NOT NULL COMMENT 'USUARIO QUE MODIFICA EL REGISTRO',
  `eliminado` datetime DEFAULT NULL COMMENT 'USUARIO QUE ELIMINA EL REGISTRO',
  `eliminado_por` int(10) unsigned DEFAULT NULL COMMENT 'USUARIO QUE ELIMINA EL REGISTRO',
  PRIMARY KEY (`id`),
  KEY `fk_reservas_conductores1_idx` (`id_conductor`),
  KEY `fk_reservas_ubicaciones1_idx` (`id_ubicacion_origen`),
  KEY `fk_reservas_ubicaciones2_idx` (`id_ubicacion_destino`),
  KEY `fk_reservas_vehiculos1_idx` (`id_vehiculo`),
  KEY `fk_servicio_user_creado_por_idx` (`creado_por`),
  KEY `fk_servicio_user_actualizado_por_idx` (`actualizado_por`),
  KEY `fk_servicio_user_eliminado_por_idx` (`eliminado_por`),
  CONSTRAINT `fk_servicio_conductor` FOREIGN KEY (`id_conductor`) REFERENCES `conductor` (`id`) ON DELETE NO ACTION ON UPDATE NO ACTION,
  CONSTRAINT `fk_servicio_ubicacion_destino` FOREIGN KEY (`id_ubicacion_destino`) REFERENCES `ubicacion` (`id`) ON DELETE NO ACTION ON UPDATE NO ACTION,
  CONSTRAINT `fk_servicio_ubicacion_origen` FOREIGN KEY (`id_ubicacion_origen`) REFERENCES `ubicacion` (`id`) ON DELETE NO ACTION ON UPDATE NO ACTION,
  CONSTRAINT `fk_servicio_user_actualizado_por` FOREIGN KEY (`actualizado_por`) REFERENCES `dreamfactory`.`user` (`id`) ON DELETE NO ACTION ON UPDATE NO ACTION,
  CONSTRAINT `fk_servicio_user_creado_por` FOREIGN KEY (`creado_por`) REFERENCES `dreamfactory`.`user` (`id`) ON DELETE NO ACTION ON UPDATE NO ACTION,
  CONSTRAINT `fk_servicio_user_eliminado_por` FOREIGN KEY (`eliminado_por`) REFERENCES `dreamfactory`.`user` (`id`) ON DELETE NO ACTION ON UPDATE NO ACTION,
  CONSTRAINT `fk_servicio_vehiculo` FOREIGN KEY (`id_vehiculo`) REFERENCES `vehiculo` (`id`) ON DELETE NO ACTION ON UPDATE NO ACTION
) ENGINE=InnoDB AUTO_INCREMENT=385 DEFAULT CHARSET=utf8;
