DROP TABLE IF EXISTS `universidad`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!40101 SET character_set_client = utf8 */;
CREATE TABLE `universidad` (
  `id` int(11) NOT NULL AUTO_INCREMENT COMMENT 'IDENTIFICADOR PRINCIPAL',
  `nro_documento` varchar(255) NOT NULL COMMENT 'NUMERO DE DOCUMENTO DE LA UNIVERSIDAD',
  `nombre` varchar(255) NOT NULL COMMENT 'NOMBRE DE LA UNIVERSIDAD',
  `id_ciudad` int(11) NOT NULL COMMENT 'CIUDAD DE LA UNIVERSIDAD',
  `direccion` varchar(255) NOT NULL COMMENT 'DIRECCIN DE LA UNIVERSIDAD',
  `telefono` varchar(255) NOT NULL COMMENT 'TELEFONO DE LA UNIVERSIDAD',
  `nombre_contacto` varchar(255) DEFAULT NULL COMMENT 'NOMBRE DEL CONTACTO EN LA UNIVERSIDAD',
  `telefono_contacto` varchar(255) DEFAULT NULL COMMENT 'TELEFONO DE CONTACTO DE LA UNIVERSIDAD',
  `email_contacto` varchar(255) DEFAULT NULL COMMENT 'EMAIL DE CONTACTO DE LA UNIVERSIDAD',
  `dominios` varchar(255) NOT NULL,
  `estado` tinyint(1) DEFAULT '1',
  `creado` timestamp NULL DEFAULT CURRENT_TIMESTAMP COMMENT 'HORA DE CREACIN DEL REGISTRO',
  `creado_por` int(10) unsigned DEFAULT NULL COMMENT 'USUARIO QUE CREA EL REGISTRO',
  `actualizado` timestamp NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP COMMENT 'HORA DE ACTUALIZACIN DEL REGISTRO',
  `actualizado_por` int(10) unsigned DEFAULT NULL COMMENT 'USUARIO QUE MODIFICA EL REGISTRO',
  `eliminado` datetime DEFAULT NULL COMMENT 'USUARIO QUE ELIMINA EL REGISTRO',
  `eliminado_por` int(11) DEFAULT NULL,
  PRIMARY KEY (`id`),
  KEY `fk_universidad_ciudad1_idx` (`id_ciudad`),
  KEY `fk_universidad_user_creado_por_idx` (`creado_por`),
  KEY `fk_universidad_user_actualizado_por_idx` (`actualizado_por`),
  KEY `ndx_universidad_eliminado_por` (`eliminado_por`),
  CONSTRAINT `fk_universidad_ciudad` FOREIGN KEY (`id_ciudad`) REFERENCES `ciudad` (`id`) ON DELETE NO ACTION ON UPDATE NO ACTION,
  CONSTRAINT `fk_universidad_user_actualizado_por` FOREIGN KEY (`actualizado_por`) REFERENCES `dreamfactory`.`user` (`id`) ON DELETE NO ACTION ON UPDATE NO ACTION,
  CONSTRAINT `fk_universidad_user_creado_por` FOREIGN KEY (`creado_por`) REFERENCES `dreamfactory`.`user` (`id`) ON DELETE NO ACTION ON UPDATE NO ACTION
) ENGINE=InnoDB AUTO_INCREMENT=4 DEFAULT CHARSET=utf8;
/*!40101 SET character_set_client = @saved_cs_client */;

