CREATE DEFINER=`drodriguez`@`localhost` FUNCTION `get_related_data`(p_tabla VARCHAR(255), p_id INTEGER) RETURNS varchar(255) CHARSET latin1
BEGIN
	DECLARE v_salida VARCHAR(255);
	CASE p_tabla
    WHEN "pais" THEN
		SELECT nombre COLLATE utf8_unicode_ci
        INTO v_salida
        FROM pais WHERE id = p_id;
	WHEN "ciudad" THEN
		SELECT nombre COLLATE utf8_unicode_ci
        INTO v_salida
        FROM ciudad WHERE id = p_id;
	WHEN "tipo_documento" THEN
		SELECT nombre COLLATE utf8_unicode_ci
        INTO v_salida
        FROM tipo_documento WHERE id = p_id;
	WHEN "tipo_ubicacion" THEN
		SELECT nombre COLLATE utf8_unicode_ci
        INTO v_salida
        FROM tipo_ubicacion WHERE id = p_id;
	WHEN "tipo_ubicacion_by_ubicacion_id" THEN
		SELECT tu.nombre COLLATE utf8_unicode_ci
        INTO v_salida
        FROM ubicacion u 
				JOIN tipo_ubicacion tu
					ON tu.id = u.id_tipo_ubicacion
					WHERE u.id = p_id;
	WHEN "id_tipo_ubicacion" THEN
		SELECT id_tipo_ubicacion COLLATE utf8_unicode_ci
        INTO v_salida
        FROM ubicacion WHERE id = p_id;
	WHEN "universidad" THEN
		SELECT nombre COLLATE utf8_unicode_ci
        INTO v_salida
        FROM universidad WHERE id = p_id;
	WHEN "id_universidad_by_id_usuario" THEN
		SELECT id_universidad COLLATE utf8_unicode_ci
        INTO v_salida
        FROM usuario WHERE id = p_id;
	WHEN "empresa" THEN
		SELECT nombre COLLATE utf8_unicode_ci
        INTO v_salida
        FROM empresa WHERE id = p_id;
    WHEN "ubicacion" THEN
		SELECT nombre COLLATE utf8_unicode_ci
        INTO v_salida
        FROM ubicacion WHERE id = p_id;
	WHEN "tipo_movimiento" THEN
		SELECT nombre COLLATE utf8_unicode_ci
        INTO v_salida
        FROM tipo_movimiento WHERE id = p_id;
	WHEN "direccion" THEN
		SELECT direccion COLLATE utf8_unicode_ci
        INTO v_salida
        FROM direccion WHERE id = p_id;
	WHEN "usuario" THEN
		SELECT nro_documento COLLATE utf8_unicode_ci
        INTO v_salida
        FROM usuario WHERE id = p_id;
	WHEN "nombre_usuario" THEN
		SELECT CONCAT(primer_nombre,' ',primer_apellido) COLLATE utf8_unicode_ci
        INTO v_salida
        FROM usuario WHERE id = p_id;
	WHEN "conductor" THEN
		SELECT concat(primer_nombre, ' ', primer_apellido) COLLATE utf8_unicode_ci
		INTO v_salida
		FROM conductor WHERE id = p_id;
	WHEN "vehiculo" THEN
		SELECT placa COLLATE utf8_unicode_ci
		INTO v_salida
		FROM vehiculo WHERE id = p_id;
	WHEN "user" THEN
		SELECT email COLLATE utf8_unicode_ci
		INTO v_salida
		FROM dreamfactory.user WHERE id = p_id;
	WHEN "user_name" THEN
		SELECT name COLLATE utf8_unicode_ci
		INTO v_salida
		FROM dreamfactory.user WHERE id = p_id;
	WHEN "user_phone" THEN
		SELECT phone COLLATE utf8_unicode_ci
		INTO v_salida
		FROM dreamfactory.user WHERE id = p_id;
	WHEN "creado_por" THEN
		SELECT `name` COLLATE utf8_unicode_ci
		INTO v_salida
		FROM dreamfactory.user WHERE id = p_id;
	WHEN "actualizado_por" THEN
		SELECT `name` COLLATE utf8_unicode_ci
		INTO v_salida
		FROM dreamfactory.user WHERE id = p_id;
	WHEN "valor_parametro" THEN
		SELECT `valor` COLLATE utf8_unicode_ci
		INTO v_salida
		FROM parametro_universidad WHERE id_parametro = p_id;
	WHEN "estado_reserva" THEN
		SELECT CASE p_id
				  WHEN '-1' THEN 'Cancelada'
				  WHEN '0'  THEN 'Nueva'
				  WHEN '1'  THEN 'Utilizada'
				  WHEN '2'  THEN 'Sin Utilizar'
				  WHEN '3'  THEN 'Finalizada'
				  ELSE NULL
				  END
		INTO v_salida;
	WHEN "telefono_usuario" THEN
		SELECT telefono COLLATE utf8_unicode_ci
        INTO v_salida
        FROM usuario WHERE id = p_id;
	END CASE;

RETURN v_salida;
END ;;
DELIMITER ;
