CREATE DEFINER=`root`@`localhost` FUNCTION `obtener_saldo`(p_id_usuario INT, p_id_universidad INT) RETURNS text CHARSET utf8
BEGIN
	DECLARE v_saldo DOUBLE DEFAULT 0;
    
    SELECT COALESCE(sum(valor),0) INTO v_saldo
    FROM movimiento WHERE id_usuario = p_id_usuario
    AND estado=1 
    AND eliminado is null;
    
RETURN CONCAT('{"id_usuario":',p_id_usuario,',"saldo":',v_saldo,'}');
END ;;
