CREATE DEFINER=`root`@`localhost` FUNCTION `obtener_servicios`(p_id_usuario INT, p_id_universidad INT,
	p_id_direccion_origen INT, p_id_ubicacion_destino INT, p_id_ubicacion_origen INT,
    p_id_direccion_destino INT, p_fechahora DATETIME) RETURNS longblob
BEGIN
	DECLARE v_id INT(11);
    DECLARE v_cupo INT(11);
    DECLARE v_json  LONGBLOB;

	SET @@group_concat_max_len = 1024*1024*1024;
    
    SELECT
		CONCAT('[',GROUP_CONCAT(
			CONCAT(
				'{"id":',COALESCE(id,'null'),',
				"cupo":',COALESCE(cupo,0),',
                "ubicacion_origen": "',COALESCE(origen,''),'",
                "ubicacion_destino":"',COALESCE(destino,''),'",
                "fecha":"',COALESCE(fecha,0),'",
                "inicio_recogida":"',COALESCE(inicio_recogida,0),'",
                "en_destino":"',COALESCE(en_destino,0),'"
                }')),']')  INTO v_json
	FROM
    (
	SELECT s.id,o.nombre as origen,d.nombre as destino,
		DATE_FORMAT(inicio_recogida_esperado,'%Y-%m-%d') as fecha,
        DATE_FORMAT(inicio_recogida_esperado,'%H:%i:%s') as inicio_recogida,
        DATE_FORMAT(en_destino_esperado,'%H:%i:%s') as en_destino,
		ABS(v.capacidad_pasajeros- COUNT(r.id)) as cupo
	FROM servicio s
	INNER JOIN ubicacion o ON (o.id=s.id_ubicacion_origen) AND o.id_universidad=p_id_universidad AND o.eliminado IS NULL
	INNER JOIN ubicacion d ON (d.id=s.id_ubicacion_destino) AND d.id_universidad=p_id_universidad AND d.eliminado IS NULL
	INNER JOIN vehiculo v ON v.id=s.id_vehiculo AND v.eliminado IS NULL
	LEFT JOIN reserva r ON r.id_servicio = s.id AND r.estado!=-1
	WHERE unix_timestamp(s.inicio_recogida_esperado) > unix_timestamp(CURRENT_TIMESTAMP()) 
    AND s.inicio_recogida_real IS NULL
	AND s.eliminado IS NULL
	AND (p_id_direccion_origen IS NULL OR ( p_id_direccion_origen IN (SELECT id FROM direccion WHERE id_usuario = p_id_usuario AND eliminado IS NULL AND o.id=direccion.id_ubicacion)) )
	AND (p_id_direccion_destino IS NULL OR ( p_id_direccion_destino IN (SELECT id FROM direccion WHERE id_usuario = p_id_usuario AND eliminado IS NULL AND d.id=direccion.id_ubicacion)) )
	AND (p_id_ubicacion_origen IS NULL OR  p_id_ubicacion_origen = o.id)
	AND (p_id_ubicacion_destino IS NULL OR  p_id_ubicacion_destino = d.id )
    AND ( p_fechahora IS NULL 
		OR ( 	
			p_id_ubicacion_origen IS NULL AND 
			en_destino_esperado  BETWEEN DATE_SUB( p_fechahora, INTERVAL 2 HOUR )  AND DATE_ADD( p_fechahora, INTERVAL 2 HOUR )
		)
        OR ( 	
			p_id_ubicacion_destino IS NULL AND 
			inicio_recogida_esperado  BETWEEN DATE_SUB( p_fechahora, INTERVAL 2 HOUR )  AND DATE_ADD( p_fechahora, INTERVAL 2 HOUR )
		)
	)
	GROUP BY s.id
    ) tmp;
    IF v_json IS NULL THEN
		SET v_json:='[]';
	END IF;
RETURN v_json;

END ;;
DELIMITER ;
