CREATE DEFINER=`drodriguez`@`localhost` FUNCTION `obtener_ubicacion`(p_lat DOUBLE PRECISION, p_lon DOUBLE PRECISION) RETURNS text CHARSET utf8
BEGIN
	DECLARE done_cursor INTEGER DEFAULT 0;
	DECLARE puntos varchar(1000) DEFAULT "";
	DECLARE id_zona INTEGER;
    DECLARE poligono POLYGON;
    DECLARE punto POINT;
    DECLARE v_enZona INTEGER DEFAULT -1;
    DECLARE cursorZonas CURSOR FOR
        SELECT id
        FROM ubicacion 
        WHERE eliminado IS NULL AND id_tipo_ubicacion = 2 AND habilitado = 1;
        DECLARE CONTINUE HANDLER FOR NOT FOUND SET done_cursor = 1;
    
    SET punto:=ST_GEOMFROMTEXT(CONCAT('POINT( ',p_lat, ' ',p_lon,' )'));
    
	open cursorZonas;
    LOOP_ZONAS: LOOP
		FETCH cursorZonas INTO id_zona;
        IF done_cursor = 1 THEN 
			LEAVE LOOP_ZONAS;
		END IF;	
		BLK_ZONAS_LOOP: BEGIN
			DECLARE done_cursor2 INTEGER DEFAULT 0;
            DECLARE v_latitud DOUBLE PRECISION;
            DECLARE v_longitud DOUBLE PRECISION;
            DECLARE v_latitud_ini DOUBLE PRECISION;
            DECLARE v_longitud_ini DOUBLE PRECISION;
            DECLARE v_orden INT;
            DECLARE v_pts_pol TEXT  DEFAULT '';
            DECLARE v_ini INT DEFAULT 0;
            
			DECLARE cursorPuntos CURSOR FOR
                SELECT latitud,longitud,orden
                FROM punto_ubicacion pu
                WHERE id_ubicacion = id_zona
                AND eliminado IS NULL
                ORDER BY orden;
            DECLARE CONTINUE HANDLER FOR NOT FOUND SET done_cursor2 = 1;
            
            open cursorPuntos;
            LOOP_PUNTOS: LOOP
				FETCH cursorPuntos INTO v_latitud, v_longitud, v_orden;
                IF done_cursor2 = 1 THEN 
					LEAVE LOOP_PUNTOS;
				END IF;	
                IF v_ini = 0 THEN 
					SET v_pts_pol:=CONCAT(v_pts_pol,' ',v_latitud,' ',v_longitud);
                    SET v_ini:=1;
                    SET v_latitud_ini:=v_latitud;
                    SET v_longitud_ini:=v_longitud;
				ELSE 
					SET v_pts_pol:=CONCAT(v_pts_pol,', ',v_latitud,' ',v_longitud,' ');
				END IF;
            END LOOP LOOP_PUNTOS;
            SET POLIGONO:=ST_GEOMFROMTEXT(CONCAT('POLYGON(( ',v_pts_pol,', ',v_latitud_ini,' ',v_longitud_ini,' ))'));
            
            IF st_contains(poligono, punto) THEN
				set v_enZona:=id_zona;
                set done_cursor:=1;
            END IF;
		END BLK_ZONAS_LOOP;
    END LOOP LOOP_ZONAS;

	RETURN v_enZona;
END ;;
DELIMITER ;
