CREATE DEFINER=`airlinku`@`localhost` FUNCTION `prueba`(`p_id_conductor`             INT(11), `p_id_vehiculo` INT(11),
                                     `p_inicio_recogida_esperado` DATETIME, `p_en_destino_esperado` DATETIME,
                                     `p_id_conductor_actual`      INT(11), `p_id_vehiculo_actual` INT(11)) RETURNS tinyint(4)
BEGIN
	DECLARE v_count INTEGER;

	SELECT COUNT(*) 
	INTO v_count
	FROM servicio
	WHERE (
			((id_conductor = p_id_conductor
			AND p_inicio_recogida_esperado < en_destino_esperado 
			AND p_en_destino_esperado > inicio_recogida_esperado) AND (id_conductor != p_id_conductor_actual))

		OR ((id_vehiculo = p_id_vehiculo
			AND p_inicio_recogida_esperado < en_destino_esperado 
			AND p_en_destino_esperado > inicio_recogida_esperado) AND (id_vehiculo != p_id_vehiculo_actual))
    ) AND (eliminado IS NULL);

    IF v_count = 0 THEN 
		RETURN 1;
    ELSE
		RETURN 0;
	END IF;
END ;;
