CREATE DEFINER=`root`@`localhost` PROCEDURE `cancelar_reserva`(
	p_id_universidad INTEGER,
    p_id_usuario INTEGER,
    p_id_reserva INTEGER
)
BEGIN
	DECLARE v_id_servicio INTEGER DEFAULT 0;
    DECLARE v_id_tipo_movimiento INTEGER DEFAULT 0;
    DECLARE v_valor_servicio DOUBLE;
    DECLARE v_cantidad_sin_fondo INT;
    DECLARE v_estado_reserva INTEGER;
    DECLARE v_inicio_recogida_esperado DATETIME;
    DECLARE v_inicio_recogida_real DATETIME;
    DECLARE v_maximo_cancelacion INT;
    SELECT id_servicio,estado INTO v_id_servicio,v_estado_reserva
    FROM reserva WHERE id = p_id_reserva AND id_usuario = p_id_usuario;
    
    SELECT COALESCE(valor,30) INTO v_maximo_cancelacion
    FROM parametro_universidad pu 
    INNER JOIN parametro p ON p.id=pu.id_parametro
    WHERE p.nombre = 'TIEMPO_MAXIMO_CANCELACION';
    
    IF v_id_servicio = 0 || v_id_servicio IS NULL THEN
		SELECT false as exito, 'Reserva Invlida' as mensaje;
	ELSE
		SELECT inicio_recogida_esperado, inicio_recogida_real INTO v_inicio_recogida_esperado, v_inicio_recogida_real
        FROM servicio WHERE id = v_id_servicio;
        IF CURRENT_TIMESTAMP >= ( v_inicio_recogida_esperado- INTERVAL v_maximo_cancelacion MINUTE ) || v_inicio_recogida_real IS NOT NULL
        THEN
			SELECT false as exito, 'Se ha pasado el tiempo limite para cancelar la reserva.' as mensaje;
        ELSE
			
			SELECT valor*-1 as valor_servicio
			INTO v_valor_servicio
			FROM movimiento m
			INNER JOIN reserva r ON r.id_movimiento=m.id 
			WHERE r.id =p_id_reserva;
                
			
			SELECT id INTO v_id_tipo_movimiento 
			FROM tipo_movimiento WHERE nombre = 'DEVOLUCION'
			AND eliminado IS NULL LIMIT 1;
            
			START TRANSACTION;
            INSERT INTO movimiento (id_usuario,id_tipo_movimiento, valor,estado,creado,creado_por,actualizado,actualizado_por)
            VALUES(p_id_usuario,v_id_tipo_movimiento,v_valor_servicio,1,CURRENT_TIMESTAMP,1,CURRENT_TIMESTAMP,1);
            
            UPDATE reserva SET estado=-1 WHERE id=p_id_reserva;
            SELECT true as exito, 'Reserva cancelada exitosamente' as mensaje;
            COMMIT;
        END IF;
    END IF;
END ;;
DELIMITER ;
