CREATE DEFINER=`root`@`localhost` PROCEDURE `confirmar_usuario`(p_codigo VARCHAR(255))
BEGIN
    DECLARE v_cantidad INTEGER DEFAULT 0;
    DECLARE v_user_id INTEGER;
    DECLARE v_nombre VARCHAR(255);
    
    -- SELECT id INTO v_user_id FROM dreamfactory.user WHERE confirm_code=p_codigo ;
    
    SELECT u.primer_nombre,u.user_id,COUNT(1) INTO v_nombre,v_user_id,v_cantidad 
    FROM usuario u
    INNER JOIN  dreamfactory.user us ON us.id = u.user_id
    WHERE u.codigo = p_codigo
    AND LENGTH(u.codigo)>10
	AND us.is_active = 0
    GROUP BY primer_nombre,user_id
    LIMIT 1;
    
    IF v_cantidad = 1 THEN
		UPDATE dreamfactory.user SET is_active = 1 WHERE id = v_user_id;
        UPDATE usuario SET codigo = NULL WHERE user_id =  v_user_id AND codigo = p_codigo;
		SELECT v_nombre as nombre,'Tu cuenta fue confirmada exitosamente. Ya puedes empezar a utilizar los servicios de AirLink U.' as mensaje,
				1 as valido;
	ELSE
		SELECT us.id,COUNT(1) INTO v_user_id,v_cantidad 
        FROM dreamfactory.user us
        WHERE confirm_code = p_codigo 
        GROUP BY id
        LIMIT 1;
        IF v_cantidad = 1 THEN
			UPDATE dreamfactory.user SET is_active = 1 WHERE id = v_user_id;
			UPDATE usuario SET codigo = NULL WHERE user_id =  v_user_id;
            SELECT v_nombre as nombre,'Tu cuenta fue confirmada exitosamente. Ya puedes empezar a utilizar los servicios de AirLink U.' as mensaje,
				1 as valido;
        ELSE
			SELECT 'Extrao' as nombre,'El cdigo que ingresaste no existe o ya fue utilizado' as mensaje,
				0 as valido;
		END IF;
    END IF;
    
END ;;
DELIMITER ;
