CREATE DEFINER=`drodriguez`@`localhost` PROCEDURE `crear_reserva`(`p_id_universidad` INT(11), `p_id_usuario` INT(11), `p_id_servicio` INT(11),
                                 `p_id_direccion`   INT(11))
BEGIN
	DECLARE v_saldo_actual DOUBLE;
    DECLARE v_valor_servicio DOUBLE;
    DECLARE v_cantidad_sin_fondo INT;
    DECLARE v_user_id INT;
    DECLARE v_id_direccion INT;
    DECLARE v_id_tipo_movimiento INT;
    DECLARE v_cupo INT;
    DECLARE v_reservas_serv_actual INT;
    
    -- OBTIENE EL VALOR DEL SERVICIO Y LA CANTIDAD DE SERVICIOS SIN FONDO PUEDE HACER UN USUARIO
    SELECT SUM(COALESCE(p1.valor*1,0)) as valor_servicio,SUM(COALESCE(p2.valor,0)) as cantidad_sin_fondo
    INTO v_valor_servicio,v_cantidad_sin_fondo
    FROM parametro p 
    LEFT JOIN parametro_universidad p1 
		ON p1.id_parametro=p.id AND p.nombre='VALOR_SERVICIO' AND  p1.id_universidad = p_id_universidad
    LEFT JOIN parametro_universidad p2 
		ON p2.id_parametro=p.id AND p.nombre='SERVICIOS_SIN_FONDO' AND p2.id_universidad = p_id_universidad;
    
    
    -- OBTENIENDO EL TIPO DE MOVIENTO
    SELECT id INTO v_id_tipo_movimiento 
    FROM tipo_movimiento WHERE nombre = 'SERVICIO'
    AND eliminado IS NULL LIMIT 1;
    
    -- OBTENIENDO EL USER_ID
    SELECT user_id INTO v_user_id
    FROM usuario WHERE id = p_id_usuario;
    
    -- VERIFICAR SI EL USUARIO YA RESERV EN EL SERVICIO ESCOGIDO
    SELECT COUNT(*) INTO v_reservas_serv_actual
    FROM reserva WHERE id_usuario = p_id_usuario AND id_servicio = p_id_servicio AND estado != -1;

    -- OBTIENE EL SALDO ACTUAL DEL USUARIO
    SELECT COALESCE(SUM(valor),0) INTO v_saldo_actual 
    FROM movimiento 
    WHERE estado = 1 
    AND id_usuario = p_id_usuario;
    
    
	SELECT d.id INTO v_id_direccion
	FROM direccion d
	WHERE d.id_usuario = p_id_usuario  AND d.id=p_id_direccion LIMIT 1;
    
    -- SI YA RESERV EN EL SERVICIO ESCOGIDO, NO DEJARLO RESERVAR DE NUEVO
    IF (v_reservas_serv_actual > 0) THEN
    	SELECT false as exito, 'Ya se reserv este servicio' as mensaje;
    ELSE
    -- SI NO TIENE CUPO EL SERVICIO ABANDONAR
	
    
    -- SI NO TIENE SALDO LE RESPONDE
	    IF (v_saldo_actual - v_valor_servicio) < (v_valor_servicio*-1*v_cantidad_sin_fondo) THEN
			SELECT false as exito, 'Saldo Insuficiente' as mensaje;
		ELSE
			SELECT v.capacidad_pasajeros - COUNT(r.id) INTO v_cupo
			FROM vehiculo v 
			INNER JOIN servicio s ON s.id_vehiculo = v.id
			LEFT JOIN reserva r ON r.id_servicio = s.id  AND r.eliminado IS NULL AND r.estado != -1
			WHERE s.id = p_id_servicio
			GROUP BY s.id;
			
			IF v_cupo < 1 THEN
				SELECT false as exito, 'Servicio sin cupo' as mensaje;
			ELSE 
				BEGIN
	            DECLARE _rollback INT DEFAULT 0;
				DECLARE CONTINUE HANDLER FOR SQLEXCEPTION SET _rollback = 1;
				START TRANSACTION;                        
				
				-- CREANDO MOVIMIENTO PARA DESCARGAR DEL SALDO DEL USUARIO
				INSERT INTO movimiento (id_usuario,id_tipo_movimiento,valor,medio_pago, estado, creado_por,actualizado_por)
				VALUES(p_id_usuario, v_id_tipo_movimiento, v_valor_servicio*-1,'R',1,v_user_id,v_user_id);
	            
	            
				
				-- CREANDO LA RESERVA
				INSERT INTO reserva (id_servicio,id_usuario,id_direccion,id_movimiento,estado, creado_por,actualizado_por)
				VALUES(p_id_servicio,p_id_usuario,v_id_direccion,LAST_INSERT_ID(),0,v_user_id,v_user_id);
				
					
					IF _rollback = 1 THEN 
						SELECT false as exito, CONCAT('Error al crear la reserva ','-',p_id_servicio,'-',p_id_usuario,'-',p_id_direccion,'-',LAST_INSERT_ID(),'-',0,'-',v_user_id,'-',v_user_id) as mensaje;
	                    SHOW ERRORS;
	                    ROLLBACK;
					ELSE
						COMMIT;
						SELECT true as exito, 'Reserva Creada Correctamente' as mensaje, LAST_INSERT_ID() as id_reserva, v_saldo_actual - v_valor_servicio as nuevo_saldo;
					END IF;
				
				END;
			END IF;
			
			
	    END IF;
    END IF;
END ;;
DELIMITER ;
/*!50003 SET sql_mode              = @saved_sql_mode */ ;
/*!50003 SET character_set_client  = @saved_cs_client */ ;
/*!50003 SET character_set_results = @saved_cs_results */ ;
/*!50003 SET collation_connection  = @saved_col_connection */ ;
/*!50003 DROP PROCEDURE IF EXISTS `obtener_historial_pasajero` */;
/*!50003 SET @saved_cs_client      = @@character_set_client */ ;
