CREATE DEFINER=`root`@`localhost` PROCEDURE `obtener_historial_pasajero`(
	p_id_usuario INT
    )
BEGIN
	SET @cons = "SELECT
			d.direccion as `Direccin de Recogida`,
			if(m.valor < 0,(m.valor*(-1)),m.valor) as Valor,
			CONCAT(c.primer_nombre,' ',c.primer_apellido) as Conductor,
			CONCAT(v.marca,' ',v.modelo) as Vehculo,
			v.placa as Placa,
			u_or.nombre as `Ubicacin Origen`,
			u_de.nombre as `Ubicacin Destino`,
			CONCAT(s.inicio_recogida_real,' - ',s.fin_recogida_real) as `Fecha Recogida`,
			s.en_destino_real as `Hora de llegada`
		FROM reserva r
			INNER JOIN direccion d ON r.id_direccion = d.id
			INNER JOIN movimiento m ON r.id_movimiento = m.id
			INNER JOIN servicio s ON r.id_servicio=s.id
			LEFT JOIN tarifa t ON s.id_ubicacion_origen = t.id_ubicacion_origen AND s.id_ubicacion_destino = t.id_ubicacion_destino
			LEFT JOIN conductor c ON s.id_conductor = c.id
			LEFT JOIN vehiculo v ON s.id_vehiculo = v.id
			LEFT JOIN ubicacion u_or ON s.id_ubicacion_origen = u_or.id
			LEFT JOIN ubicacion u_de ON s.id_ubicacion_destino = u_de.id";
    IF p_id_usuario = 0 THEN
		SET @filtro = 'WHERE r.eliminado IS NULL;';
    ELSE
		SET @filtro = CONCAT('WHERE r.id_usuario = ',p_id_usuario,' AND r.eliminado IS NULL;');
    END IF;
    
    SET @consultaFinal = CONCAT(@cons,' ',@filtro);
    
    PREPARE stmt FROM @consultaFinal;
	EXECUTE stmt;
	DEALLOCATE PREPARE stmt;

END ;;
DELIMITER ;
