CREATE DEFINER=`root`@`localhost` PROCEDURE `obtener_listado_servicios`(
	p_id_conductor INT,
    p_id_universidad INT,
    p_id_empresa INT,
    p_origen INT,
    p_destino INT)
BEGIN
	SET @cons= "SELECT 
					r.id_servicio as `Servicio`, 
					r.estado as `Estado Servicio`, 
					c.id_tipo_documento as `Tipo Documento`, 
					c.nro_documento as `No. Documento`, 
					concat(c.primer_nombre,' ',if(c.segundo_nombre is null,'',c.segundo_nombre),' ',c.primer_apellido,if(c.segundo_apellido is null,'',c.segundo_apellido)) as `Nombre`, 
					c.licencia_conduccion as `No. de licencia`,
					c.email as `Correo`,
					c.telefono as `Telfono`,
					u.nombre AS `Universidad`,
					em.nombre AS `Empresa`,
					ubi_origen.nombre as `Origen`,
					ubi_destino.nombre as `Destino`,
					s.inicio_recogida_real as `Inicio en Recoger`,
					s.fin_recogida_real as `Fin en Recoger`,
					s.en_destino_real as `Llegada a Destino`,
					avg(r.calificacion) as `Calificacion`
				FROM
					conductor c
				INNER JOIN
					servicio s ON s.id_conductor = c.id
				INNER JOIN 
					reserva r ON r.id_servicio = s.id
				LEFT JOIN
					ubicacion ubi_origen ON ubi_origen.id = s.id_ubicacion_origen 
				LEFT JOIN
					ubicacion ubi_destino ON ubi_destino.id = s.id_ubicacion_destino
				LEFT JOIN 
					universidad u ON u.id = ubi_origen.id_universidad
				LEFT JOIN 
					empresa em ON em.id = s.id_vehiculo
				WHERE (r.estado = 1 OR r.estado = 3)";
	
    SET @gr = "GROUP BY r.id_servicio;";
    
	IF p_id_conductor = 0 THEN
		SET @filterCond = "";
	ELSE
		SET @filterCond = CONCAT("AND c.id = ",p_id_conductor);
	END IF;
    
	IF p_id_universidad = 0 THEN
		SET @filterUniv = "";
	ELSE
		SET @filterUniv = CONCAT("AND u.id = ",p_id_universidad);
	END IF;
    
	IF p_id_empresa = 0 THEN
		SET @filterIdEmp = "";
	ELSE
		SET @filterIdEmp = CONCAT("AND em.id = ",p_id_empresa);
	END IF;
    
	IF p_origen = 0 THEN
		SET @filterOrig = "";
	ELSE
		SET @filterOrig = CONCAT("AND ubi_origen.id = ",p_origen);
	END IF;
    
	IF p_destino = 0 THEN
		SET @filterDest = "";
	ELSE
		SET @filterDest = CONCAT("AND ubi_destino.id = ",p_destino);
	END IF;
        
    SET @consultaFinal = CONCAT(@cons,' ',@filterCond,' ',@filterUniv,' ',@filterIdEmp,' ',@filterOrig,' ',@filterDest,' ',@gr);
    
    PREPARE stmt FROM @consultaFinal;
	EXECUTE stmt;
	DEALLOCATE PREPARE stmt;
	
END ;;
DELIMITER ;
/*!50003 SET sql_mode              = @saved_sql_mode */ ;
/*!50003 SET character_set_client  = @saved_cs_client */ ;
/*!50003 SET character_set_results = @saved_cs_results */ ;
