CREATE DEFINER=`root`@`localhost` PROCEDURE `obtener_movimientos`(
    p_id_universidad INT,
    p_id_usuario INT,
	p_cantidad INT, 
	p_desde INT)
BEGIN
    SELECT m.valor valor, tm.descripcion descripcion, m.creado creado
    FROM movimiento m
	JOIN tipo_movimiento tm ON m.id_tipo_movimiento = tm.id
    LEFT JOIN usuario u ON m.id_usuario = u.id
    WHERE m.estado = 1 AND u.id_universidad = p_id_universidad AND m.id_usuario = p_id_usuario
    ORDER BY m.creado DESC
    LIMIT p_cantidad OFFSET p_desde;
END ;;
