CREATE DEFINER=`drodriguez`@`localhost` PROCEDURE `obtener_notificaciones`()
BEGIN
	SELECT n.id as id_notificacion, n.id_usuario, n.id_tipo_notificacion, n.fecha_envio as fecha_notificacion, n.id_reserva, n.leida, res.id_servicio, res.id_direccion, res.id_movimiento, IF(res.estado=0,'Sin Utilizar','Utilizada') as estado_reserva, CONCAT(us.primer_nombre,' ',us.primer_apellido) as nombre_estudiante, veh.placa as placa_vehiculo, tnot.nombre as nombre_tipo_notificacion
	FROM airlink_u.notificacion n
	LEFT JOIN airlink_u.reserva res ON res.id = n.id_reserva
    LEFT JOIN airlink_u.usuario us ON us.id = n.id_usuario
    LEFT JOIN airlink_u.servicio ser ON ser.id = res.id_servicio
    LEFT JOIN airlink_u.vehiculo veh ON veh.id = ser.id_vehiculo
    LEFT JOIN airlink_u.tipo_notificacion tnot ON tnot.id = n.id_tipo_notificacion
	WHERE n.eliminado is null
	AND id_reserva is not null;
END ;;
