					c.email as `Correo`,
					c.telefono as `Telfono`,
					u.nombre AS `Universidad`,
					em.nombre AS `Empresa`,
					count(r.id_servicio) as `Servicios Realizados`,
					avg(r.calificacion) as `Calificacion`
