	IF p_id_universidad = 0 THEN
		SET @filterUniv = "";
	ELSE
		SET @filterUniv = CONCAT("AND u.id = ",p_id_universidad);
	END IF;
    
	IF p_id_empresa = 0 THEN
		SET @filterIdEmp = "";
	ELSE
		SET @filterIdEmp = CONCAT("AND em.id = ",p_id_empresa);
	END IF;
            
    SET @consultaFinal = CONCAT(@cons,' ',@filterCond,' ',@filterUniv,' ',@filterIdEmp);
    
    PREPARE stmt FROM @consultaFinal;
	EXECUTE stmt;
	DEALLOCATE PREPARE stmt;
END ;;
