CREATE DEFINER=`drodriguez`@`localhost` PROCEDURE `PROC_PRUEBA`(`p_id_conductor` INT(11), `p_id_vehiculo` INT(11),
								`p_inicio_recogida_esperado` DATETIME, `p_en_destino_esperado` DATETIME,
								`p_id_conductor_actual`      INT(11),  `p_id_vehiculo_actual` INT(11))
BEGIN
	DECLARE v_count INTEGER;
    
	IF (p_id_conductor = p_id_conductor_actual) THEN
		SET @cond = 'AND (id_conductor != @p_id_conductor_actual)';
	ELSE
		SET @cond = '';
	END IF;

	IF (p_id_vehiculo = p_id_vehiculo_actual) THEN
		SET @vehi = 'AND (id_vehiculo != @p_id_vehiculo_actual)';
	ELSE
		SET @vehi = '';
	END IF;
    
	SET @mainQuery = 	CONCAT('SELECT COUNT(*)
		FROM servicio
		WHERE ((id_conductor = ',p_id_conductor,'
				AND "',p_inicio_recogida_esperado,'" < en_destino_esperado
				AND "',p_en_destino_esperado,'" > inicio_recogida_esperado ',@cond,')
			OR (id_vehiculo = ',p_id_vehiculo,'
				AND "',p_inicio_recogida_esperado,'" < en_destino_esperado
				AND "',p_en_destino_esperado,'" > inicio_recogida_esperado ',@vehi,'))
		AND eliminado IS NULL');

	PREPARE stmnt FROM @mainQuery;
	EXECUTE stmnt;
END ;;
DELIMITER ;
/*!50003 SET sql_mode              = @saved_sql_mode */ ;
/*!50003 SET character_set_client  = @saved_cs_client */ ;
