CREATE DEFINER=`drodriguez`@`localhost` PROCEDURE `reporte_cierre_contable`(
    p_operacion VARCHAR(255),
    p_fecha_inicio VARCHAR(255),
    p_fecha_fin VARCHAR(255)
    )
BEGIN
    CASE p_operacion
	WHEN "recargas_general" THEN
		-- OBTENER TOTAL DE LAS RECARGAS DE LA SEMANA
		SELECT	COUNT(m.id_tipo_movimiento) AS `Cantidad de Movimientos`,
				SUM(m.valor) AS `Recarga Total`
		FROM movimiento m
		JOIN tipo_movimiento tm ON tm.id = m.id_tipo_movimiento
		WHERE m.creado BETWEEN CONCAT(p_fecha_inicio,' 00:00:00') AND CONCAT(DATE_ADD(p_fecha_inicio, INTERVAL 6 DAY),' 23:59:59')
		AND (m.id_tipo_movimiento = 1 OR m.id_tipo_movimiento = 7);
	WHEN "datos_semana" THEN
		-- OBTENER TODA LA INFO DE LA SEMANA
		SELECT	tm.nombre AS `Tipo Movimiento`,
				COUNT(m.id_tipo_movimiento) AS `Cantidad Movimientos`,
				SUM(m.valor) AS `Total`
		FROM movimiento m
		JOIN tipo_movimiento tm ON tm.id = m.id_tipo_movimiento
		WHERE m.creado BETWEEN CONCAT('2017-06-24',' 00:00:00') AND CONCAT('2017-07-30',' 23:59:59')
		GROUP BY m.id_tipo_movimiento;
	WHEN "movimientos_tipo_medio" THEN
		-- TODOS LOS MOVIMIENTOS DIFERENCIADOS POR TIPO DE MOVIMIENTO Y MEDIO DE PAGO
		SELECT	tm.nombre AS `Tipo Movimiento`,
				COUNT(m.id_tipo_movimiento) AS `Cantidad Movimientos`,
				m.medio_pago,
				SUM(m.valor) AS `Total`
		FROM movimiento m
		JOIN tipo_movimiento tm ON tm.id = m.id_tipo_movimiento
		WHERE m.creado BETWEEN CONCAT(p_fecha_inicio,' 00:00:00') AND CONCAT(p_fecha_fin,' 23:59:59')
		GROUP BY m.medio_pago, m.id_tipo_movimiento;
	ELSE
		SELECT	*
		FROM movimiento;
    END CASE;

END ;;
DELIMITER ;
/*!50003 SET sql_mode              = @saved_sql_mode */ ;
/*!50003 SET character_set_client  = @saved_cs_client */ ;
/*!50003 SET character_set_results = @saved_cs_results */ ;
