CREATE DEFINER=`drodriguez`@`localhost` PROCEDURE `reporte_historial_pasajero`(
	p_id_usuario INT,
    p_fecha_inicio VARCHAR(255),
    p_fecha_fin VARCHAR(255)
    )
BEGIN
	SET @cons = "SELECT
			d.direccion as `direccion_recogida`,
			if(m.valor < 0,(m.valor*(-1)),m.valor) as valor,
			CONCAT(c.primer_nombre,' ',c.primer_apellido) as conductor,
			CONCAT(v.marca,' ',v.modelo) as vehiculo,
			v.placa as placa,
			u_or.nombre as `ubicacion_origen`,
			u_de.nombre as `ubicacion_destino`,
			CONCAT(s.inicio_recogida_real,' - ',s.fin_recogida_real) as `fecha_recogida`,
			s.en_destino_real as `hora_llegada`
		FROM reserva r
			INNER JOIN direccion d ON r.id_direccion = d.id
			INNER JOIN movimiento m ON r.id_movimiento = m.id
			INNER JOIN servicio s ON r.id_servicio=s.id
			LEFT JOIN tarifa t ON s.id_ubicacion_origen = t.id_ubicacion_origen AND s.id_ubicacion_destino = t.id_ubicacion_destino
			LEFT JOIN conductor c ON s.id_conductor = c.id
			LEFT JOIN vehiculo v ON s.id_vehiculo = v.id
			LEFT JOIN ubicacion u_or ON s.id_ubicacion_origen = u_or.id
			LEFT JOIN ubicacion u_de ON s.id_ubicacion_destino = u_de.id
            WHERE r.creado BETWEEN CONCAT(?,' 00:00:00') AND CONCAT(?,' 23:59:59')";
    IF p_id_usuario = 0 THEN
		SET @filtro = 'AND r.eliminado IS NULL;';
