		SET @filtro = CONCAT('AND r.id_usuario = ',p_id_usuario,' AND r.eliminado IS NULL;');
    END IF;
    
    SET @consultaFinal = CONCAT(@cons,' ',@filtro);
    
    PREPARE stmt FROM @consultaFinal;
